import axios from 'axios';
import { useState } from "react-router-dom";

function Checklog(){
    const [msg, setMsg] = useState("aaaa");

    
    return(
        
        <h1 onClick={() => setMsg(getDataAxios)}>{msg}</h1>
    )
}

function getDataAxios(){
    const response = axios.get("http://localhost:3080/server/checklog");
    return response.data.message;
}

export default Checklog;
